import{S as a}from"./chunks/Swagger.DlzHgbB4.js";import{c as e,J as i,a5 as o,o as r}from"./chunks/framework.sTBfJIaM.js";const s=o('<h1 id="propiedades-api" tabindex="-1">Propiedades API <a class="header-anchor" href="#propiedades-api" aria-label="Permalink to &quot;Propiedades API&quot;">​</a></h1><h2 id="introduccion" tabindex="-1">Introducción <a class="header-anchor" href="#introduccion" aria-label="Permalink to &quot;Introducción&quot;">​</a></h2><p>Bienvenidos a la documentación de la API de Propiedades, una interfaz diseñada para facilitar la gestión integral de propiedades inmobiliarias. Esta API proporciona capacidades extensas para crear, listar, actualizar, marcar como destacadas, reservar, publicar, y buscar propiedades, permitiendo a los usuarios gestionar eficazmente su catálogo de inmuebles.</p><p>A través de esta API, los usuarios pueden realizar operaciones detalladas sobre propiedades, incluyendo la gestión de imágenes, categorías, estados de publicación, y mucho más.</p><p>Algunos de los metodos de la API no requieren autenticacion ya que son invocados desde el sitio web de la inmobiliar mientras que otros metodos si la requerien ya que forman parte del portal de administracion de la plataforma.</p><h3 id="caracteristicas-principales" tabindex="-1">Características Principales <a class="header-anchor" href="#caracteristicas-principales" aria-label="Permalink to &quot;Características Principales&quot;">​</a></h3><ul><li><strong>Gestión de Propiedades</strong>: Crea y actualiza detalles de propiedades, incluyendo información de precios, ubicación, y características.</li><li><strong>Publicación y Reserva</strong>: Controla la visibilidad de tus propiedades marcándolas como publicadas o reservadas.</li><li><strong>Búsqueda Avanzada</strong>: Encuentra propiedades mediante criterios específicos o a través de coincidencias en el título y la descripción.</li><li><strong>Destacados y Categorización</strong>: Marca propiedades como destacadas y organízalas en categorías para una navegación más fácil.</li></ul><h3 id="empezando" tabindex="-1">Empezando <a class="header-anchor" href="#empezando" aria-label="Permalink to &quot;Empezando&quot;">​</a></h3><p>Para comenzar a utilizar la API de Propiedades, necesitarás obtener un token de usuario valido a través de nuestro proceso de login <a href="/developer/autenticacion.html#introduccion">Autenticacion</a>. Una vez autenticado, podrás acceder a los diferentes endpoints proporcionados, utilizando métodos HTTP como GET, POST, PATCH, y DELETE para interactuar con los recursos de la API.</p><p>Cada solicitud y respuesta está estructurada en un formato JSON claro y comprensible, asegurando una integración sencilla. Para más detalles sobre los endpoints específicos y cómo utilizarlos, continúa explorando esta documentación.</p><h2 id="propiedades" tabindex="-1">Propiedades <a class="header-anchor" href="#propiedades" aria-label="Permalink to &quot;Propiedades&quot;">​</a></h2><p>Aquí puedes profundizar en los detalles específicos relacionados con la gestión de propiedades, incluyendo ejemplos de solicitudes y respuestas para cada operación disponible.</p>',12),u=JSON.parse('{"title":"Propiedades API","description":"","frontmatter":{},"headers":[],"relativePath":"developer/propiedades.md","filePath":"developer/propiedades.md"}'),d={name:"developer/propiedades.md"},m=Object.assign(d,{setup(n){return(t,c)=>(r(),e("div",null,[s,i(a,{id:"dialersSwagger",yaml:"/specs/propiedades/propiedades.yaml"})]))}});export{u as __pageData,m as default};
